                <img
                    alt={`monster ${name}`}
                    src={`https://robohash.org/${id}?set=set2&size=180x180`}
                >
                </img>
                <h2>{name}</h2>
                <p>{email}</p>
            </div>
        )
    }

}

export default Card;
